export default function Boardpostform({dummyPost}){
    return(
        <div>
            <img src ={dummyPost[0].image} alt ={dummyPost[0].title} />
            <span>{dummyPost[0].title}</span>
            <span>{dummyPost[0].content}</span>
            <span>{dummyPost[0].total_likes}</span>
        </div>
    )
}
